import React from "react"
import "./home.css"



const Home = () => {

  function setup(e) {
    alert('You clicked setup.');
  }

  function requestMeeting(e) {
    alert('You clicked request.');
  }

  return (

    <>
      <section className='hero'>
        <div>

          <h3>Welcome Arya to TOPY Station</h3>
        <div>
          <button onClick={setup}>Setup Meeting</button>
          <button onClick={requestMeeting}>Incoming Request</button>
        </div>
        </div>


      </section>
    </>
  )
}
export default Home
